<!DOCTYPE html>
<html ng-app="app">
    <head>
        <title></title>
    </head>
    <body ng-controller="AppCtrl as main">
        <nav class="navbar navbar-inverse navbar-fixed-top">
            <div class="container">
                <div class="navbar-header">
                    <button type="button" data-toggle="collapse" data-target="#navbar" aria-expanded="false" aria-controls="navbar" class="navbar-toggle collapsed"><span class="sr-only">Toggle navigation</span><span class="icon-bar"></span><span class="icon-bar"></span><span class="icon-bar"></span></button><a href="#" class="navbar-brand">Project name</a>
                </div>
                <div id="navbar" class="navbar-collapse collapse">
                    <form class="navbar-form navbar-right">
                        <div class="form-group">
                            <input type="text" placeholder="Email" autocomplete="off" style="background-image: url(data:image/png;base64,); background-attachment: scroll; background-position: 100% 50%; background-repeat: no-repeat;" class="form-control">
                        </div>
                        <div class="form-group">
                            <input type="password" placeholder="Password" autocomplete="off" style="background-image: url(data:image/png;base64,); background-attachment: scroll; background-position: 100% 50%; background-repeat: no-repeat;" class="form-control">
                        </div>
                        <button type="submit" class="btn btn-success">Sign in</button>
                    </form>
                </div>
            </div>
        </nav>
        <div class="jumbotron">
            <div class="container">
                <h1>Hello, world!</h1>
                <h1> <i class="fa fa-cog"></i></h1>
                <p>This is a template for a simple marketing or informational website. It includes a large callout called a jumbotron and three supporting pieces of content. Use it as a starting point to create something more unique.</p>
                <p><a href="#" role="button" class="btn btn-primary btn-lg">Learn more &raquo;</a></p>
            </div>
        </div>
        <div class="container">
            <div ui-view="main">
            </div>
            <hr>
            <footer>
                <p>&copy; Company 2014</p>
            </footer>
        </div>
    </body>
</html>
